import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Auth from './Components/auth/Auth';
import Notes from './Components/pages/Notes';
import Create from './Components/pages/Create';
import { createMuiTheme, ThemeProvider } from '@material-ui/core';
import { purple } from '@mui/material/colors';
import { makeStyles } from '@material-ui/core';



const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#fefefe'
    },
    secondary: purple
  },

  typography: {
    fontFamily: 'Quicksand',

    fontWightLight: 400,

    fontWightRegular: 500,

    fontWightMedium: 600,

    fontWightBold: 700
  },
});


const useStyles = makeStyles({
  page: 
  {
    background: '#f9f9f9',
    width: '100%' 
  },

  field: {
    marginTop: 20,
    marginBotton: 20,
    display: 'block'
  }
});



const App = () => 
{
  const classes = useStyles();


  return (
    <div>
      <ThemeProvider theme={theme} >
        <BrowserRouter>
          <Routes>
                <Route path="/" element={<Auth className={classes.page}/>}/>
                <ThemeProvider theme={theme} >
                  <Route path="/Create" element={<Create classes={classes}/>}/>
                  <Route path="/Notes" element={<Notes className={classes.page}/>}/>
                </ThemeProvider>  
          </Routes>
        </BrowserRouter>
      </ThemeProvider>  
    </div>
  )
}

export default App;
